import React, { Component } from "react";
import "./Car.css";

class Car extends Component {
  constructor(props) {
    super(props);
  }

  state = {};

  showCarDetails() {}

  render() {
    return (
      <div className="Car">
        {
          <div>
            <div
              title={this.props.car.brand}
              onClick={this.showCarDetails}
            ></div>
          </div>
        }
        <div> Model: {/*{car.model}*/}</div>
      </div>
    );
  }
}

export default Car;
